import './App.css';
import { memo, useState } from 'react';
import {mapa} from "./ArregloMapa"

function App() {

  const [memoria,setMemoria]=useState(mapa);

  return (
    <div>
      <h1>Memoria</h1>
      <table class="table table bordered">
        <thead>
        <tr>
        {memoria.map((bit)=>(
          <th scope="col">{bit.posicion}</th>
          ))}
        </tr>
      </thead>
      </table>

    </div>
  );
}

export default App;
